    public int[] findDiagonalOrder(List<List<Integer>> nums) {
        List<Point> pointList = new ArrayList<>();
        int column;
        int row = 0;
        for(List<Integer> list : nums){
            column = 0;
            for(Integer value : list){
                pointList.add(new Point(row,row + column,value));
                column++;
            }
            row++;
        }
        Collections.sort(pointList, new Comparator<Point>() {
            @Override
            public int compare(Point o1, Point o2) {
                if(o1.sum>o2.sum)
                    return 1;
                else if(o1.sum < o2.sum)
                    return -1;
                else {
                    return o2.row - o1.row;
                }
            }
        });
        return pointList.stream().map(e-> e.val).mapToInt(e->e).toArray();
    }

    public class Point{
        int row;
        int sum; //row + column
        int val;

        public Point(int row, int sum, int val) {
            this.row = row;
            this.sum = sum;
            this.val = val;
        }
    }


    /**
     * faster solution
     * @param nums
     * @return
     */
    public int[] findDiagonalOrderV2(List<List<Integer>> nums) {
        if(nums == null || nums.size() == 0) return new int[0];
        int count = 0;
        // 从左上 到 右下 看成一行行的排列
        List<List<Integer>> res = new ArrayList<>();
        for(int i = 0; i< nums.size(); i++){
            List<Integer> list = nums.get(i);
            for(int j = 0; j < list.size(); j ++){
                if(i + j  == res.size()){
                    res.add(new ArrayList<>());
                }
                count++;
                res.get(i + j).add(list.get(j));
            }
        }

        int[] arr = new int[count];
        int index = 0;
        for(int k = 0; k < res.size(); k++){
            List<Integer> list = res.get(k);
            for(int i = list.size() - 1 ; i >= 0; i --){
                arr[index ++] = list.get(i);
            }
        }
        return arr;
    }

    public int[] findDiagonalOrderOlc(List<List<Integer>> nums) {
        List<Integer> result = new ArrayList<>();
        int u = nums.size();
        int[] indexForLists = new int[u];
        int width = 0;
        for(int i = 0; i < u;i++){
            width = Math.max(width,i+nums.get(i).size());
        }
        for(int i = 0; i < width;i++){
                for (int j = (i<u?i:u-1); j >= 0 ; j--) {
                    int t = indexForLists[j];
                    if(t<nums.get(j).size()) {
                        result.add(nums.get(j).get(t));
                        indexForLists[j]++;
                    }
                }
        }
        return result.stream().mapToInt(e->e).toArray();
    }


